angular.module('ViewItemDirective', []).directive('viewItem', function ($compile) {
  return {
    scope: {
      model: '=ngModel',
      placeholder: '@placeholder'
    },
    restrict: 'E',
    link: function(scope, element){
      scope.showIf = function(type){
        return (scope.model.resourceType == type);
      }
      scope.showThumbnailIfExists = function(){
        return (angular.isUndefined(scope.model.thumbnail) || (scope.model.thumbnail == null)) ? false : ((scope.model.thumbnail.length == 0) ? false : true);
      }
      var template = '<div class="view-item">\
                        <div class="hover-bg">\
                          <a href="#">\
                            <div class="hover-text">\
                              <h4 ng-bind="model.title"></h4>\
                              <small ng-bind="model.date | Date"></small>\
                              <div class="clearfix"></div>\
                              <i class="fa fa-arrow-right"></i>\
                            </div>\
                            <img ng-show="showThumbnailIfExists();" ng-src="{{model.thumbnail}}" class="img-responsive full-width">\
                            <img ng-show="!showThumbnailIfExists();" ng-src="{{placeholder}}" class="img-responsive full-width">\
                            <div class="view-item-icon-container">\
                              <span ng-show="showIf(' + "'Music'" + ')"class="fa fa-music music-fix"></span>\
                              <span ng-show="showIf(' + "'Diary'" + ')"class="fa fa-youtube diary-fix"></span>\
                              <span ng-show="showIf(' + "'Blog'" + ')"class="fa fa-rss blog-fix"></span>\
                              <span ng-show="showIf(' + "'Podcast'" + ')"class="fa fa-microphone podcast-fix"></span>\
                              <span ng-show="showIf(' + "'Article'" + ')"class="fa fa-newspaper-o article-fix"></span>\
                              <span ng-show="showIf(' + "'Game'" + ')"class="fa fa-gamepad game-fix"></span>\
                              <span ng-show="showIf(' + "'2D art'" + ')"class="fa fa-paint-brush brush-fix"></span>\
                              <span ng-show="showIf(' + "'3D art'" + ')"class="fa fa-cube cube-fix"></span>\
                            </div>\
                            <div ng-bind="' + "'#'" + ' + model.number" class="view-item-number">\
                            </div>\
                          </a>\
                        </div>\
                      </div>';
      var content = $compile(template)(scope);
      element.append(content);
    }
  }
});

angular.module('DateFilter', []).filter('Date', function (){
  return function(unformatted, includeTime, onlyYear){
    if (unformatted){
      if (onlyYear){
        return moment(unformatted).format("YYYY");
      } else {
        if (includeTime){
          return moment(unformatted).format("DD.MM.YYYY HH.mm");
        } else {
          return moment(unformatted).format("DD.MM.YYYY");
        }
      }
    }
  };
});

angular.module('Routes', []).config(['$routeProvider', '$locationProvider', function($routeProvider, $locationProvider) {
  $routeProvider
  // Admin
  .when('/admin/authorize', {
    templateUrl: '../../views/admin/authorize.html',
    controller: 'AuthorizeController',
    resolve: {
      load : function(Authorization){
        return Authorization.gotoDashboardIfLoggedIn();
      }
    }
  })
  .when('/admin/dashboard', {
    redirectTo: '/admin/dashboard/1'
  })
  .when('/admin/dashboard/:page', {
    templateUrl: '../../views/admin/dashboard.html',
    controller: 'DashboardController',
    resolve: {
      load : function(Authorization){
        return Authorization.proceedIfLoggedIn();
      }
    }
  })
  .when('/admin/publish/', {
    templateUrl: '../../views/admin/publish.html',
    controller: 'PublishController',
    resolve: {
      load : function(Authorization){
        return Authorization.proceedIfLoggedIn();
      }
    }
  })
  .when('/admin/publish/:id', {
    templateUrl: '../../views/admin/publish.html',
    controller: 'PublishController',
    resolve: {
      load : function(Authorization){
        return Authorization.proceedIfLoggedIn();
      }
    }
  })
  // Home
  .when('/', {
    templateUrl: '../../views/home.html',
    controller: 'HomeController'
  })
  .when('/home', {
    templateUrl: '../../views/home.html',
    controller: 'HomeController'
  })
  // Activities
  .when('/feed', {
    redirectTo: '/feed/activity/1'
  })
  .when('/feed/:type/:page', {
    templateUrl: '../../views/feed/feed.html',
    controller: 'FeedController'
  })
  // Projects
  .when('/projects', {
    templateUrl: '../../views/projects/projects.html',
    controller: 'ProjectsController'
  })
  .when('/projects/type/:type', {
    templateUrl: '../../views/projects/type.html',
    controller: 'TypeController'
  })
  .when('/projects/type/:type/:page', {
    templateUrl: '../../views/projects/type.html',
    controller: 'TypeController'
  })
  .when('/view/:id', {
    templateUrl: '../../views/view.html',
    controller: 'ViewController'
  })
  // About
  .when('/about', {
    templateUrl: '../../views/about.html',
    controller: 'AboutController'
  })
  // Contact
  .when('/contact', {
    templateUrl: '../../views/contact.html',
    controller: 'ContactController'
  })
  // Not found
  .when('/404', {
    templateUrl: '../../views/system/404.html'
  })
  // Otherwise
  .otherwise({
    redirectTo: '/404'
  })

  $locationProvider.html5Mode(true);
}]);

